import * as actionTypes from "../actions/actionTypes";

export const updateCurrPref = () => {
    return {
        type: actionTypes.UPDATE_CURR_PREF
    };
};

export const updatePrefLocation = (lat, long) => {
    return {
        type: actionTypes.UPDATE_PREF_LOCATION,
        lat: lat,
        long: long
    }
}
